```json
{
  "application": "VASP",
  "details": {
    "software": {
      "intel": "2019.1.144",
      "openmpi": "4.0.1",
      "vasp": "5.4.4"
    },
    "resources": {
      "nodes": 1,
      "tasks": 16,
      "cpus_per_task": 1,
      "memory_per_cpu": "1000mb",
      "wall_time": "6:00:00"
    }
  }
}
```

**Explanation:**

* **Application:** The script runs the VASP (Vienna Ab initio Simulation Package) software.
* **Software:** The script loads specific versions of Intel compilers (2019.1.144) and OpenMPI (4.0.1) for compiling and running VASP (version 5.4.4).
* **Resources:**  The script requests 1 node with 16 tasks, allocating 1 CPU per task and 1000MB of memory per CPU. It also sets a walltime limit of 6 hours (6:00:00).

The script uses the SLURM (Simple Linux Utility for Resource Management) batch system to manage the execution environment and resource allocation. The script's first lines contain directives (starting with `#SBATCH`) that specify job parameters and settings.
